// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;
pragma experimental ABIEncoderV2;

contract OrderRequest {
    //Enum Status - To hold different order status in Supply chain
    enum OrderStatus {
        submitted,
        rejected,
        accepted,
        completed
    }

    //Order request info
    struct OrderInfo {
        //Order request id
        address orderRequestId;
        //Product name
        string productName;
        //Product description
        string productDesc;
        //manufacturer detail
        string manufacturerDetail;
        //retailer/requestor address
        address retailer;
        //distributor/vendor address
        address distributor;
        //notes from retailer
        string notes;
        //reason for order cancel
        string reasonForOrderCancellation;
        //order status;
        OrderStatus orderStatus;
        //order date timestamp
        uint256 orderModifiedDate;
        //additional remark from distributor
        string remark;
    }

    // custom error
    error UnderProcess(string message);
    error PriceMismatch(string message);

    //Order request details
    OrderInfo public orderInfo;

    //Create new instance of Product batch by distributor .
    //@param _productName String Name of product
    //@param _productDesc String Desc of product
    //@param _manufacturerName String Manufacturer name
    //@param _retailer Address retailer store address
    constructor(
        string memory _productName,
        string memory _productDesc,
        string memory _manufacturerDetail,
        string memory _notes,
        address _distributor,
        address _retailer
    ) {
        orderInfo.orderRequestId = address(this);
        orderInfo.productName = _productName;
        orderInfo.productDesc = _productDesc;
        orderInfo.orderStatus = OrderStatus(0);
        orderInfo.manufacturerDetail = _manufacturerDetail;
        orderInfo.notes = _notes;
        orderInfo.retailer = _retailer;
        orderInfo.distributor = _distributor;
        orderInfo.orderModifiedDate = block.timestamp;
    }

    //Get the order request status.
    function getOrderRequestStatus() public view returns (uint256) {
        return uint256(orderInfo.orderStatus);
    }

    //Reject order received from retailer
    function reject(string memory _reason) public returns (bool) {
        if (updateOrderStatus(1, 0)) {
            orderInfo.reasonForOrderCancellation = _reason;
            return true;
        }
    }

    //Accept order received from retailer
    function accept() public returns (bool) {
        return updateOrderStatus(2, 0);
    }

    //Complete order received from retailer
    function complete(string memory _remark) public returns (bool) {
        if (updateOrderStatus(3, 2)) {
            orderInfo.remark = _remark;
            return true;
        }
    }

    //Generic method to update order status
    function updateOrderStatus(uint256 _updatedStatus, uint256 _prevStatus)
        private
        returns (bool)
    {
        if (orderInfo.orderStatus != OrderStatus(_prevStatus)) {
            revert UnderProcess("PREVIOUS_STEP_NOT_COMPLETED");
        } else {
            orderInfo.orderStatus = OrderStatus(_updatedStatus);
            orderInfo.orderModifiedDate = block.timestamp;
            return true;
        }
    }
}
